import React, {useEffect, useState} from 'react'
import logo from './logo.svg';
import './App.css';

function App() {

  const url = 'http://127.0.0.1:5000/comparator/'

  const [comparators, setComparators] = useState()

  const fechApi = async () => {
    const response = await fetch(url)
    const responseJSON = await response.json()
    setComparators(responseJSON)
  }

   useEffect(() => {
    fechApi()
   },[])

  return (
    <div className="App">
      hola mundo
      <ul>
        { !comparators ? 'Cargando...' : 
          comparators.comparatorList.map( (comparator,index)=>{
            return <li>{comparator.product_name} {comparator.url}</li>
          })
        }
      </ul>
    </div>
  );
}

export default App;
